import React from 'react'

const SelectResource = ({title, name, id, multiple, ...rest }) => {
    console.log(rest.data)
  return (
    <>
        <label htmlFor={id}>{title} <span className="text-danger">*</span></label>
        <select
         className="form-control select2"
         name={name}
         id={id} 
         multiple = {multiple ? "multiple" : ""}

         >
            <option>Select</option>
            <option value="SH1">Shopping 1</option>
            <option value="SH2">Shopping 2</option>
            <option value="SH3">Shopping 3</option>
            <option value="SH4">Shopping 4</option>
        </select>
    </>
  )
}

export default SelectResource
